import React from 'react';

const User = props => {
    const usersData = props.items;
    const artistData = usersData.map((artist) =>
    <div>
        <h1>{artist.name}</h1>
        <a href={artist.external_urls.spotify}>
            <img src={artist.images[0].url} alt="artist"/>
        </a>

    </div>
    ) 
    return (
        <div>
            {artistData}
        </div>
    )
}
export default User;
